        string farmer_name;
        string location;
        string crop_type;
        uint phone_number;
        uint quantity;
        uint unit_price;
        uint total_price; // unit_price * quantity  
    }

    struct lot{
        address fid ;
        address tester_id; 
        uint    lot_id  ;
        uint    grade;
        string  test_date;
